css:
atom-workspace {
  display: flex;
  flex-direction: column;
  height: 100%;
  overflow: hidden;
  position: relative;
  color: #424243;
  background-color: #e5e5e6;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
atom-workspace atom-workspace-axis {
  position: relative;
}
atom-workspace atom-workspace-axis.horizontal {
  display: flex;
  flex: 1;
  min-width: 0;
  min-height: 0;
}
atom-workspace atom-workspace-axis.vertical {
  display: flex;
  flex: 1;
  flex-direction: column;
  min-width: 0;
  min-height: 0;
}
